class s{static randomLenNum(t=4,a=!0){const r=(Math.random()*Math.pow(10,t)).toFixed(0);return a?Number(r):new Array(t-r.length).fill("0").join("")+r}static randomStr(){return Math.random().toString(36).slice(-8)}static randomBoolean(t=.5){return Math.random()<t}static randomRange(t,a,r=0){return this.precision(Math.random()*(a-t)+t,r)}static randomArray(t){return t[Math.floor(Math.random()*t.length)]}static randomArrayLength(t){return Math.floor(Math.random()*t)}static precision(t,a=2){const r=Math.pow(10,a),n=Number(t);return isNaN(n)?0:Math.round(n*r)/r}static between(t,a,r=!1){const n=typeof t=="number"?t:new Date(t).valueOf(),e=a.map(o=>typeof o=="number"?o:new Date(o).valueOf()).sort();return r?n>=e[0]&&n<=e[1]:n>=e[0]&&n<e[1]}}export{s as G};
